import React, { useState, useEffect } from 'react';
import axios from 'axios';
import Swal from 'sweetalert2';
import styled from 'styled-components';

const Container = styled.div`
  max-width: 800px;
  margin: 0 auto;
  padding: 20px;
`;

const Title = styled.h1`
  font-size: 24px;
  margin-bottom: 20px;
`;

const Form = styled.form`
  margin-bottom: 20px;
`;

const Label = styled.label`
  display: block;
  margin-bottom: 10px;
`;

const TextArea = styled.textarea`
  width: 100%;
  height: 100px;
  resize: vertical;
`;

const Input = styled.input`
  display: block;
  margin-top: 5px;
`;

const Button = styled.button`
  padding: 10px 20px;
  background-color: #007bff;
  color: #fff;
  border: none;
  border-radius: 4px;
  cursor: pointer;
`;

const PostContainer = styled.div`
  margin-bottom: 20px;
`;

const PostTitle = styled.h3`
  font-size: 18px;
`;

const PostImage = styled.img`
  max-width: 100%;
  margin-top: 10px;
`;

const PostContent = styled.p`
  margin-top: 10px;
`;

const FeedPage = () => {
  const [content, setContent] = useState('');
  const [postImage, setPostImage] = useState(null);
  const [posts, setPosts] = useState([]);

  useEffect(() => {
    getPosts();
  }, []);

  const getPosts = async () => {
    try {
      const token = localStorage.getItem('token');
      const response = await axios.get('http://localhost:8080/posts', {
        headers: {
          Authorization: `Bearer ${token}`,
        },
      });

      setPosts(response.data);
    } catch (error) {
      if (error.response && error.response.status === 401) {
        console.error('Token de autenticação inválido');
        // Redirecione para a página de login ou faça alguma ação de tratamento de erro
      } else {
        console.error('Erro ao obter os posts:', error);
      }
    }
  };

  const handlePostSubmit = async (e) => {
    e.preventDefault();

    const formData = new FormData();
    formData.append('content', content);
    formData.append('postImage', postImage);

    try {
      const token = localStorage.getItem('token');
      const response = await axios.post('http://localhost:8080/posts', formData, {
        headers: {
          'Content-Type': 'multipart/form-data',
          Authorization: `Bearer ${token}`,
        },
      });

      // Atualiza a lista de posts após o envio bem-sucedido
      getPosts();

      // Limpa o formulário
      setContent('');
      setPostImage(null);
    } catch (error) {
      console.error('Erro ao criar o post:', error);
      Swal.fire({
        icon: 'error',
        title: 'Erro',
        text: error.response.data,
      });
    }
  };

  return (
    <Container>
      <Title>Feed</Title>
      <Form onSubmit={handlePostSubmit}>
        <Label>
          Conteúdo:
          <TextArea value={content} onChange={(e) => setContent(e.target.value)}></TextArea>
        </Label>
        <Label>
          Imagem:
          <Input type="file" onChange={(e) => setPostImage(e.target.files[0])} />
        </Label>
        <Button type="submit">Enviar</Button>
      </Form>

      <Title>Posts</Title>
      {posts.map((post) => (
        <PostContainer key={post.id}>
          <div>
            <PostTitle>{post.username}</PostTitle>
            <PostImage src={`http://localhost:8080/posts/${post.image_url}`} alt="Post" />
            <PostContent>{post.content}</PostContent>
          </div>
        </PostContainer>
      ))}
    </Container>
  );
};

export default FeedPage;
